cssVarsTemplate:
@tailwind base;
@tailwind components;
@tailwind utilities;

@layer base {
  :root {
    --background: 0 0% 100%;
    --foreground: 13 81.1% 14.5%;
    --card: 0 0% 100%;
    --card-foreground: 13 81.1% 14.5%;
    --popover: 0 0% 100%;
    --popover-foreground: 13 81.1% 14.5%;
    --primary: 15.3 74.6% 27.8%;
    --primary-foreground: 33.3 100% 96.5%;
    --secondary: 34.3 100% 91.8%;
    --secondary-foreground: 15.3 74.6% 27.8%;
    --muted: 34.3 100% 91.8%;
    --muted-foreground: 24.6 95% 53.1%;
    --accent: 34.3 100% 91.8%;
    --accent-foreground: 15.3 74.6% 27.8%;
    --destructive: 0 84.2% 60.2%;
    --destructive-foreground: 33.3 100% 96.5%;
    --border: 32.1 97.7% 83.1%;
    --input: 32.1 97.7% 83.1%;
    --ring: 13 81.1% 14.5%;
    --radius: 0.5rem;
    --chart-1: 12 76% 61%;
    --chart-2: 173 58% 39%;
    --chart-3: 197 37% 24%;
    --chart-4: 43 74% 66%;
    --chart-5: 27 87% 67%;
  }

  .dark {
    --background: 13 81.1% 14.5%;
    --foreground: 33.3 100% 96.5%;
    --card: 13 81.1% 14.5%;
    --card-foreground: 33.3 100% 96.5%;
    --popover: 13 81.1% 14.5%;
    --popover-foreground: 33.3 100% 96.5%;
    --primary: 33.3 100% 96.5%;
    --primary-foreground: 15.3 74.6% 27.8%;
    --secondary: 15 79.1% 33.7%;
    --secondary-foreground: 33.3 100% 96.5%;
    --muted: 15 79.1% 33.7%;
    --muted-foreground: 27 96% 61%;
    --accent: 15 79.1% 33.7%;
    --accent-foreground: 33.3 100% 96.5%;
    --destructive: 0 62.8% 30.6%;
    --destructive-foreground: 33.3 100% 96.5%;
    --border: 15 79.1% 33.7%;
    --input: 15 79.1% 33.7%;
    --ring: 30.7 97.2% 72.4%;
    --chart-1: 220 70% 50%;
    --chart-2: 160 60% 45%;
    --chart-3: 30 80% 55%;
    --chart-4: 280 65% 60%;
    --chart-5: 340 75% 55%;
  }
}

@layer base {
  * {
    @apply border-border;
  }
  body {
    @apply bg-background text-foreground;
  }
}
